import ExpenseItem from "./ExpenseItem";
import "./ExpenseItem.css";

function Expenses(props) {
  const expenseItemList = props.expenses.map((e) => <div><ExpenseItem key={e.id} title={e.title} amount={e.amount} date={e.date} /></div>)

  return (
    <div className="expense-item">
      { expenseItemList }
    </div>
  );
}

export default Expenses;
